import styled from "styled-components";

export const StyledHome = styled.div`
    width: 100%;
    position: absolute;
    position: relative;
    top: -85px;
    .preview {
        width: 85%;
        background-color: #fff;
        margin: 0 auto;
        padding: 16px;
        box-shadow: rgb(204 204 204) 0px 0px 3px 2px;
        padding: 12px;
        border-radius: 4px;
    }
`;
